import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav>
        <button>About</button>
        <button>Pricing</button>
        <button>Contact</button>
        <button>Login</button>
      </nav>
      <main>
        <h1>Repute.ai</h1>
      </main>
    </div>
  );
}

export default App;
